private List<LeaderLatch> waitForALeader(List<LeaderLatch> latches, Timing timing) throws InterruptedException
{
    for ( int i = 0; i < MAX_LOOPS; ++i )
    {
        List<LeaderLatch> leaders = getLeaders(latches);
        if ( leaders.size() != 0 )
        {
            return leaders;
        }
        timing.sleepABit();
    }
    return Lists.newArrayList();
}

